import React, { Component } from 'react'
import ToggleCreate from './toggleCreate'
import ToggleSelect from './toggleSelect'

class Menu extends Component{
	render(){
		return(
			<div className="bg-info">
				<ToggleCreate/>
				<ToggleSelect/>
			</div>
		)
	}
}

export default Menu
